import React from 'react';
import './Home.css';

const Home = () => {
    return (
        <main id="content">
        <section id="home-content" class="page">
            <h3>Welcome to Our Solutions</h3>
            <p>Explore our cutting-edge microservice and nanoservice architectures for IoT, Edge, and Cloud systems.</p>
        </section>
        </main>
    );
};
export default Home;
